import React from 'react';
import ContactCard from './ContactCard'; // Import the ContactCard component
import EmailCard from './EmailCard'; // Import the EmailCard component

function Contact() {
  return (
    <div className="Contact">
      <iframe
        src="https://maps.google.com/maps?width=600&amp;height=400&amp;hl=en&amp;q=Belton Place, Philippines&amp;t=h&amp;z=14&amp;ie=UTF8&amp;iwloc=B&amp;output=embed"
        width="600"
        height="450"
        style={{ border: "0" }}
        allowFullScreen=""
        loading="lazy"
      ></iframe>
      <div className="container">
        <div className="row">
          <div className="col-md-6">
            <ContactCard /> {/* Render the ContactCard component */}
          </div>
          <div className="col-md-6">
            <EmailCard /> {/* Render the EmailCard component */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Contact;
